import React from 'react'

const Overlay = props => {
    return (
        <div className="overlayBox">
            <h3>{this.props.title}</h3>
            {/* {console.log(title)} */}
            <div className="image"></div>
            <p>{props.image}</p>
            <h5>Ingredients</h5>
            <p>{props.ingredients}</p>
            <h5>Directions</h5>
            <p>{props.directions}</p>
        </div>
    )
}

export default Overlay
